import React, { Component } from 'react';

class Navbar extends Component {
    state = {  }
    render() { 
        return ( 
            <nav className="nav-wrapper grey darken-2">
                <div className="container">
                    <a href="#">Sign in</a>
                    <a href="#">Sign Out</a>
                </div>
            </nav>
         );
    }
}
 
export default Navbar;
